import React from "react";
import "./App.css";
import { Switch, Route, NavLink } from "react-router-dom";

function App({ jokeFacade }) {
  return (
    <div className="App">
      <Header />
      <h3>Hello</h3>
    </div>
  );

  function Header() {
    return (
      <div>
        <ul className="header">
          <li>
            <NavLink exact activeClassName="active" to="/">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/jokes">
              Products
            </NavLink>
          </li>
          <li>
            <NavLink activeClassName="active" to="/scrape">
              Add Book
            </NavLink>
          </li>
        </ul>
      </div>
    );
  }
}

export default App;
